import React, { Component } from 'react'
import '../App.css';

export default class footer extends Component {
  render() {
    return (
      <div className="row">
          <div className="col-md-4 col-sm-12">
            Desarrolo Web con React.js
          </div>
          <div className="col-4">
            <img className="platzi" alt="plazti"></img>
          </div>
      </div>
    )
}
}
